import React from 'react'

import '../../normalize.scss'
import '../../base.scss'

import SobreCompra from '../../components/Compras/SobreCompras';
import TermosCompra from '../../components/Compras/CondicaoCompra';
import Banner from '../../components/Header/Banner';
import View from "../view/view"

import imgBanner from '../../components/Header/Banner/destaques/Compre suas Stars/1280.png'

function Compras() {
  let contentBanner = "Nec aliquam volutpat donec sit amet"
  return (
    <View public={true}>
      <Banner imagemBanner={imgBanner} text={contentBanner} />
      <SobreCompra />
      <TermosCompra />
    </View>
  )
}

export default Compras;
